import { Link } from 'react-router-dom';

export default function Header() {
  return (
    <header className="flex justify-between items-center px-8 py-4 bg-gradient-to-r from-purple-900 to-gray-900 shadow-lg">
      <img src="/trendAiLogo.png" alt="TrendAI Logo" className="h-10" />
      <nav className="space-x-6">
        <Link to="/" className="hover:text-cyan-400">Home</Link>
        <Link to="/crypto-trend" className="hover:text-cyan-400">Crypto Trend</Link>
        <Link to="/video-gen" className="hover:text-cyan-400">Video Gen</Link>
        <Link to="/image-gen" className="hover:text-cyan-400">Image Gen</Link>
      </nav>
    </header>
  );
}
